import React, { Component } from 'react';
import { Popover, Icon } from 'antd';

export default class PopoverComponent extends Component{
    
    render(){
        const content = (
            <img src="data:image/png;base64," />
        );

        return (
            <Popover placement="right" content={content}>
                <Icon type="file" />
            </Popover>
        )
    }
}